import React from "react";

function Content({ content, handleView }) {
  const parsedDate = new Date(content.createdAt).toLocaleDateString("ko-kr");

  return (
    <li className="content" id={content.id}>
      <div className="content__name">{content.username}</div>
      <div
        className="content__title"
        onClick={() =>
          handleView(content.username, content.title, content.content)
        }
      >
        {content.title}
      </div>
      <div className="content__createdAt">{parsedDate}</div>
    </li>
  );
}

export default Content;
